  const setNavActive = useStoreActions(action => action.setActive)
  useEffect(()=>{

    setNavActive('about')


  }, [])

  return (
    <Layout>

    <div className='container-fluid container-about'>
        <h1 className="text">hello about</h1>
    </div>



    </Layout>
  )
}

export default about
